import "./Share.scss";

export default function Share() {
   return (
      <div className="share">
         <div className="shareWrapper">
            <div className="shareTop">
               <img src="" alt="" className="shareProfileImg" />
               <input type="text" className="shareInput" />
            </div>
            <hr className="shareHr" />
            <div className="shareBottom"></div>
         </div>
      </div>
   );
}
